// import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
// import NavDropdown from 'react-bootstrap/NavDropdown';

import logo from '../../../images/Frame.svg';
import Btn from '../../../Components/Button/Button';
import svg from '../../../images/Frame 45.svg';
import arrow from '../../../images/Vector.svg';


function NavScrollExample() {
  return (
    <Navbar  expand="lg">
      <Container fluid>
        <Navbar.Brand href="#"><img src={logo} alt='logo'/></Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll>
            <Nav.Link href="#action1">Home</Nav.Link>
            <Nav.Link href="#action2">Category</Nav.Link>
            <Nav.Link href="#action2">About</Nav.Link>
            <Nav.Link href="#action2">Contact</Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <div className="input-box">
                     <i className="fa fa-search"></i>
                     <input type="text" className="form-control" placeholder='Search something here!'/>
                     <Btn className='Btn' text="Join the community"></Btn>
                     <div className='CountryDropdown'>
                         <img src={svg} alt='Svg'/>
                         <p>VND</p>
                         <img className='arrow' src={arrow} alt="arrow"/>
                    </div>
            </div>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
